import React from "react";
import { Container, BackgroundImage, Overlay } from "./LoginStyle";

import Head from "../../PartsLog/Head";
import Body from "../../PartsLog/Body";
import Foot from "../../PartsLog/Foot";

const login = () => {
    return (
        <Container>
            <Overlay />
            <BackgroundImage >
                <Head />
                <Body />
                <Foot />

            </BackgroundImage>
        </Container>
    );
};

export default login;
